import React, { useEffect, useState } from "react";
import { apiUrl, axiosInstance, generateRefreshToken } from "../axios";

export default function AddEditMedicine() {
  const user_id = sessionStorage.getItem("user_id");
  const [formValues, setFormValues] = useState({});
  const [medicineCategories, setMedicineCategories] = useState({});

  useEffect(() => {
    getMedicineCategories();
  }, []);

  const getMedicineCategories = async () => {
    await axiosInstance
      .get(apiUrl + "/medicine/categories")
      .then((response) => {
        if (response.status === 200) {
          setMedicineCategories(response.data);
        }
      })
      .catch((error) => {
        if (error.response.status === 401) {
          generateRefreshToken(error);
        }
      });
  };

  const onChangeHandler = (e) => {
    setFormValues({ ...formValues, [e.target.name]: e.target.value });
  };

  const submit = (e) => {
    e.preventDefault();
    addMedicine();
  };

  const fileload = (e) => {
    setFormValues({
      ...formValues,
      medicine_image: e.target.files[0],
    });
  };

  const addMedicine = async () => {
    setFormValues({ ...formValues, ["user"]: user_id });
    console.log(formValues);

    await axiosInstance
      .post(apiUrl + "/medicine/", formValues, {
        headers: { "Content-Type": "multipart/form-data" },
      })
      .then((response) => {
        if (response.status === 200) {
          alert(response.data);
          window.location.reload(false);
        }
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div style={{ margin: "20px" }}>
      <form onSubmit={submit} method="post">
        <div style={{ marginBottom: "10px" }}>
          <label htmlFor="medicine_category" style={{ display: "block", marginBottom: "5px" }}>
            Medicine Category *
          </label>
          <select
            name="medicine_category"
            id="medicine_category"
            onChange={onChangeHandler}
            style={{ width: "100%", padding: "8px", borderRadius: "5px", border: "1px solid #ccc" }}
          >
            <option value="">Select</option>
            {Object.keys(medicineCategories).map((key, i) => {
              return (
                <option value={medicineCategories[key]["id"]} key={i}>
                  {medicineCategories[key]["category_name"]}
                </option>
              );
            })}
          </select>
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label htmlFor="name" style={{ display: "block", marginBottom: "5px" }}>
            Medicine Name *
          </label>
          <input
            type="text"
            name="name"
            id="name"
            onChange={onChangeHandler}
            style={{ width: "100%", padding: "8px", borderRadius: "5px", border: "1px solid #ccc" }}
            defaultValue={formValues?.name}
          />
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label htmlFor="description" style={{ display: "block", marginBottom: "5px" }}>
            Description
          </label>
          <textarea
            name="description"
            id="description"
            onChange={onChangeHandler}
            style={{ width: "100%", padding: "8px", borderRadius: "5px", border: "1px solid #ccc" }}
            defaultValue={formValues?.description}
          />
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label htmlFor="price" style={{ display: "block", marginBottom: "5px" }}>
            Price *
          </label>
          <input
            type="number"
            name="price"
            id="price"
            onChange={onChangeHandler}
            style={{ width: "100%", padding: "8px", borderRadius: "5px", border: "1px solid #ccc" }}
            defaultValue={formValues?.price}
          />
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label htmlFor="stock" style={{ display: "block", marginBottom: "5px" }}>
            Stock Quantity *
          </label>
          <input
            type="number"
            name="stock"
            id="stock"
            onChange={onChangeHandler}
            style={{ width: "100%", padding: "8px", borderRadius: "5px", border: "1px solid #ccc" }}
            defaultValue={formValues?.stock}
          />
        </div>

        <div>
          <button type="submit" style={{ padding: "10px 20px", backgroundColor: "#007bff", color: "white", borderRadius: "5px", border: "none" }}>
            Add Medicine
          </button>
        </div>
      </form>
    </div>
  );
}
